def extract_three_char_code(filename):
    try:
        pattern = r'^(\d{2})[-](.{3})\.(usfm)$'
        match = re.match(pattern, filename)

        if match:
            return match.group(2)
        else:
            return None
    except Exception as e:
        print(f"Error: {e}")
